import React from 'react';
import {
    View,
    Text,
    Button,
    StyleSheet,
    Image
} from "react-native";
import bubble from "../assets/icons/bubble.png"


const Home = ({navigation}) => {
    return (
     
        <View style={styles.container}>
            <View style={styles.header}>

            </View>

            <View style={styles.body}>
                <Image 
                    source={bubble}
                    style={{
                        width:100,
                        height: 100

                    }}
                />
                <Text style={{
                    color: 'black',
                    fontSize: 25,
                    }}>
                    This is Home
                </Text>
            </View>    
                  
                       {/* <Button title="Shop1"
                            onPress={() => navigation.navigate('Shop1')}
                        /> */}
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        backgroundColor: 'powderblue',
    },
    header: {
        height: 50,
        width: '100%',
        backgroundColor: '#46829e',
    },

    body: {
        flex: 1,
        justifyContent:'center',
        alignItems: 'center',
        alignContent:'center',
    },
    
    h1:{
        alignSelf: 'center',
        

    },
    profilePicture: {
        width:100,
        height:100
        
    }










})

export default Home;
